import logo from "./images/netflix-Logo.svg";
import background_img from "./images/background.jpg";
import React from "react";
import HeaderCss from "./header.module.css";

function Header() {
  return (
    <>
      <img src = {background_img}></img>
      <nav>
        <img className={HeaderCss.nav_logo} src={logo} alt="Netflix Logo" />
        <button className={HeaderCss.btn}>Sign In</button>
      </nav>
    </>
  );
}

export default Header;
